import React from 'react';
import './navbar.css';

export const Navbar = () => {
    const renderContent = (type, options) => {
        switch (type) {
            case 'text':
                return options.map((option, index) => (
                    <h1 key={index}>{option}</h1>
                ));
            default:
                return null; 
        }
    };

    return (
        <div>
            {renderContent('text', ['Trang chủ', 'Sản phẩm', 'Liên hệ'])}
        </div>
    );
};
